import React, { Component } from 'react';
import './App.css';
import Movie from './Movie';


// 모든 컴포넌트는 render function을 갖고 있다.
class App extends Component {
  // Render:
  // will mount -> did render -> did mount
  
  // Update:
  // componentWillReceiveProps() -> shouldComponentUpdate() == true ->
  // componentWillUpdate(){spinner 같은 것} -> render()
  //-> componentDidUpdate() {spinner를 숨길 수 있다}
  
  // 컴포넌트가 존재하기 시작할 때 작동
  
  // state는 리액트 컴포넌트 안에 있는 오브젝트
  // state가 바뀔 때마다 다시 render
  componentWillMount(){
    //API 요청
    console.log('will mount')
  }
  
  componentDidMount(){
    //데이터작업
    //state를 업데이트하려면 ths.setState를 사용해야 한다.
    
    // 1초 후 작업
    setTimeout(() => {
      this.setState({
        movies: [ // movies 요소의 변경
              {
                title:"Matrix",
                poster: "data:image/jpeg;base64,",
              },
              {
                title:"Full Metal Jacket",
                poster:"data:image/jpeg;base64,",
              },
              {
                title:"OldBoy",
                poster:"data:image/jpeg;base64,",
              },
              {
                title:"Star Wars",
                poster:"data:image/jpeg;base64,",
              },
              {
                title:"Trainspotting",
                poster:"data:image/jpeg;base64,"
              }
              ]
          // 이게 없으면 추가가 아니라 변경을해버림
          // 이전 상태를 그대로 두고 다음 값을 추가하라는 명령어 

          //...this.state.movies를 뒤에 추가한다면 추가된 아이템이 가장 먼저로 들어감
      })
    }, 5000)
  }
  
  state = {
  }
  
  _renderMovies = () => {
    const movies = this.state.movies.map((movie, index) => {
      return <Movie title={movie.title} poster={movie.poster} key={index} />
    })
    
    return movies
  }
  
  render() {
    console.log('did mount')    
    return (
      // This is called JSX
      // class -> className
      // Array.prototype.map()
      // array에 있는 각 차일드는 반드시 고유한 key prop을 가져야한다.
      // 앨리먼트가 많을경우 key를 줘야한다. key는 unique해야한다.
      
      // loading states필요
      <div className="App">
        {this.state.movies ? this._renderMovies() : "Loading"}
      </div>
    );
  }
}

export default App;
